import { Link } from "react-router-dom";
import '../../assets/styles/signInButton.style.scss'

const SignInButton = () => {

  return (
    <button className="sign-in-button">
      <Link className="sign-in-link" to='/projectList'>
        <span>
          Sign In
        </span>
      </Link>
    </button>
  );
};

export default SignInButton;
